import React from 'react'
import PropTypes from 'prop-types'
import { useHistory } from 'react-router-dom'

function Card({ values }) {
  return (
    <div>
      {values.map((ele) => {
        return (
          <div className="homepage-card" key={ele.id}>
            <h1>{ele.name}</h1>
          </div>
        )
      })}
    </div>
  )
}

Card.propTypes = {
  values: PropTypes.array.isRequired
}
export default Card
